import React from 'react';
import '../../App.css';
export default function GitHub() {
  return (
    <div className='eds-fondo'>
      <h1 className='contact-us-texto'>GitHub</h1>
      <a className='consulting' target="_blank" href="https://github.com/ElectronicDynamicSystems">Ir a Git EDS</a>
    </div>
  );
}
